import React from 'react'
import PropTypes from 'prop-types'
import './style.css'
import Jumbotron from './Jumbotron'
import MonsterSection from './MonsterSection'

function Monster (name, diet, img) { // Blueprint
  this.name = name
  this.diet = diet
  this.img = img
}

const monsters = []

const jason = new Monster('Jason Voorhees', ['Monster Energy'], 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ5Jo_OgF4rJaizQPPbyIqUvFJQvlKgx2E3coPBoZuS80sKTWyl-g')

const freddy = new Monster('Freedy Krueger', ['Dream Catchers'], 'data:image/jpeg;base64,')

const michael = new Monster('Michael Myers', ['People'], 'data:image/jpeg;base64,')

const penny = new Monster('Penny Wise', ['Kids'], 'data:image/jpeg;base64,')

const chucky = new Monster('Charles Lee Ray', ['Andy'], 'http://vignette1.wikia.nocookie.net/chuckychildsplay/images/a/a8/New_Chucky.png/revision/latest?cb=20111229223616')

monsters.push(jason, freddy, michael, penny, chucky)

// console.log(monsters)

const MonsterApp = () => {
  return (
    <div>
      <Jumbotron title='Monster Mash' />
      <MonsterSection arr={monsters} />
    </div>
  )
}

MonsterApp.propTypes = {
  monster: PropTypes.object.isRequired
}

export default MonsterApp
